import React from 'react';
import { Router, Route } from 'react-router-dom';
import Home from './screens/Home';
import HorariosPage from './screens/HorariosPage';
import FormularioCadastro from './screens/FormularioCadastro';

const App = () => {
  return (
    <Router>
      <div className="App">
        <Route path="/" exact component={Home} />
        <Route path="/horarios" component={HorariosPage} />
        <Route path="/cadastro" component={FormularioCadastro} />
      </div>
    </Router>
  );
}

export default App;
